import React from 'react';
import './App.css';

function App() {
	React.useEffect(() => {
		fetch('http://localhost:3004/api')
			.then((response) => response.json())
			.then((data) => console.log(data));
	}, []);
	return (
		<div className='App'>
			<h1>Bug Tracker</h1>
		</div>
	);
}

export default App;
